import NavBar from "../NavBar";

function HomePage(){
    return (
        <div>
            <NavBar/>
            <div className="home bg-[#443C68] xl:flex border-b-2">
                {/* left/top side of screen  */}
                <div className="bg-[#393053] h-[33%] flex justify-center border-b-2 border-b-white-500 xl:w-[33%] xl:h-[100%] xl:border-r-2 xl:border-r-white-500">
                    {/* div containing image  */}
                    <div className=" shadow-2xl img-con absolute h-[300px] w-[255px] bg-[#18122B] top-[17%] xl:top-[25%] xl:h-[400px] xl:w-[350px] xl:left-[21%] md:h-[350px] md:w-[295px]">

                    </div>
                </div>

                {/* right/down side of screen with content  */}
                <div className="h-[60%] flex flex-col justify-center xl:h-[93%] xl:w-[63%]">
                    <div className="h-[50%] mt-[160px] mb-[15px] pb-0 xl:flex-col xl:ml-[13%] md:mt-[210px]">
                        <p className="text-white text-3xl text-center xl:m-[10px] xl:text-5xl md:text-4xl">Hi, I'm Shreya Kumar!</p>
                        <p className="text-white font-bold text-xl xl:m-[10px] xl:text-3xl md:text-2xl xl:font-bold">Software Developer</p>
                    </div>
                    
                </div>
            </div>
        </div>
    );
}

export default HomePage;
